import React, { useState } from "react"; 

import { useNavigate } from 'react-router-dom';
function SignUpPopup() {
    const [formData, setFormData] = useState({
        Username: "",
        Email: "",
        Password: "",
        Phone: "",
      });

      const [employerformdata, setemployerformdata] = useState({
        username: "",
        email: "",
        password: "",
        phone: "",
      });

  const navigate = useNavigate(); // Hook for navigation

      const handleChange = (e) => {
        const { name, value } = e.target;
        setFormData({
          ...formData,
          [name]: value,
        });
      };

      const empolyehandleChange = (e) => {
        const { name, value } = e.target;
        setemployerformdata({
          ...employerformdata,
          [name]: value,
        });
      };

      const handleSubmit = async (e) => {
        e.preventDefault();

        const { Username, Password, Email, Phone } = formData;

        // Basic validation check
        if (!Username || !Password || !Email || !Phone) {

          return;
        }

        try {
          const response = await fetch("http://localhost:8080/candidate-signup", {
            method: "POST",
            headers: {
              "Content-Type": "application/json",
            },
            body: JSON.stringify(formData),
          });

          const data = await response.json();

          if (response.ok) {
      navigate('/index');
          } else {
            alert(data.message || "Failed to create user");
          }
        } catch (error) {
          console.error("Error:", error);
          alert("An error occurred. Please try again.");
        }
      };

      const handleemployeSubmit = async (e) => {
        e.preventDefault();

        const { username, password, email, phone } = formData;

        // Basic validation check
        if (!username || !password || !email || !phone) {

          return;
        }

        try {
          const response = await fetch("http://localhost:8080/employer-signup", {
            method: "POST",
            headers: {
              "Content-Type": "application/json",
            },
            body: JSON.stringify(employerformdata),
          });

          const data = await response.json();

          if (response.ok) {
      navigate('/index');
          } else {
            alert(data.message || "Failed to create user");
          }
        } catch (error) {
          console.error("Error:", error);
          alert("An error occurred. Please try again.");
        }
      };
    return (
        <>
            <div className="modal fade twm-sign-up" id="sign_up_popup" aria-hidden="true" aria-labelledby="sign_up_popupLabel" tabIndex={-1}>
                <div className="modal-dialog modal-dialog-centered">
                    <div className="modal-content">
                        <form>
                            <div className="modal-header">
                                <h2 className="modal-title" id="sign_up_popupLabel">Sign Up</h2>
                                <p>Sign Up and get access to all the features of Jobzilla</p>
                                <button type="button" className="btn-close" data-bs-dismiss="modal" aria-label="Close" />
                            </div>
                            <div className="modal-body">
                                <div className="twm-tabs-style-2">
                                    <ul className="nav nav-tabs" id="myTab" role="tablist">
                                        {/*Signup Candidate*/}
                                        <li className="nav-item" role="presentation">
                                            <button className="nav-link active" data-bs-toggle="tab" data-bs-target="#sign-candidate" type="button"><i className="fas fa-user-tie" />Candidate</button>
                                        </li>
                                        {/*Signup Employer*/}
                                        <li className="nav-item" role="presentation">
                                            <button className="nav-link" data-bs-toggle="tab" data-bs-target="#sign-Employer" type="button"><i className="fas fa-building" />Employer</button>
                                        </li>
                                    </ul>
                                    <div className="tab-content" id="myTabContent">
                                        {/*Signup Candidate Content*/}
                                        <form onSubmit={handleSubmit}>
                                        <div className="tab-pane fade show active" id="sign-candidate">
                                            <div className="row">
                                                <div className="col-lg-12">
                                                    <div className="form-group mb-3">
                                                    <input name="Username" type="text" value={formData.Username} onChange={handleChange} required className="form-control" placeholder="Username*"/>
                                                      </div>
                                                </div>
                                                <div className="col-lg-12">
                                                    <div className="form-group mb-3">
                                                    <input name="Password" type="password" value={formData.Password} onChange={handleChange} required className="form-control" placeholder="Password*"/>
                                                    </div>
                                                </div>
                                                <div className="col-lg-12">
                                                    <div className="form-group mb-3">
                                                    <input name="Email" type="email" value={formData.Email} onChange={handleChange} required className="form-control" placeholder="Email*" />
                                                    </div>
                                                </div>
                                                <div className="col-lg-12">
                                                    <div className="form-group mb-3">
                                                    <input name="Phone" type="text" value={formData.Phone} onChange={handleChange} required className="form-control" placeholder="Phone*" />
                                                    </div>
                                                </div>
                                                <div className="col-lg-12">
                                                    <div className="form-group mb-3">
                                                        <div className=" form-check">
                                                            <input type="checkbox" className="form-check-input" id="agree1" />
                                                            <label className="form-check-label" htmlFor="agree1">I agree to the <a href="#">Terms and conditions</a></label>
                                                            <p>Already registered?
                                                                <button className="twm-backto-login" data-bs-target="#sign_up_popup2" data-bs-toggle="modal" data-bs-dismiss="modal">Log in here</button>
                                                            </p>
                                                        </div>
                                                    </div>
                                                </div>
                                                <div className="col-md-12">
                                                    <button type="submit" className="site-button">Sign Up</button>
                                                </div>
                                            </div>
                                        </div>
                                        </form>
                                        {/*Signup Employer Content*/}
                                        <form onSubmit={handleemployeSubmit}>
                                        <div className="tab-pane fade" id="sign-Employer">
                                            <div className="row">
                                                <div className="col-lg-12">
                                                    <div className="form-group mb-3">
                                                        <input name="username" type="text" value={employerformdata.username} onChange={empolyehandleChange} required className="form-control" placeholder="Usearname*" />
                                                    </div>
                                                </div>
                                                <div className="col-lg-12">
                                                    <div className="form-group mb-3">
                                                        <input name="email" type="text" value={employerformdata.email} onChange={empolyehandleChange} className="form-control" required placeholder="Password*" />
                                                    </div>
                                                </div>
                                                <div className="col-lg-12">
                                                    <div className="form-group mb-3">
                                                        <input name="phone" type="text" value={employerformdata.password} onChange={empolyehandleChange}  className="form-control" required placeholder="Email*" />
                                                    </div>
                                                </div>
                                                <div className="col-lg-12">
                                                    <div className="form-group mb-3">
                                                        <input name="phone" type="text" value={employerformdata.phone} onChange={empolyehandleChange} className="form-control" required placeholder="Phone*" />
                                                    </div>
                                                </div>
                                                <div className="col-lg-12">
                                                    <div className="form-group mb-3">
                                                        <div className=" form-check">
                                                            <input type="checkbox" className="form-check-input" id="agree2" />
                                                            <label className="form-check-label" htmlFor="agree2">I agree to the <a href="#">Terms and conditions</a></label>
                                                            <p>Already registered?
                                                                <button className="twm-backto-login" data-bs-target="#sign_up_popup2" data-bs-toggle="modal" data-bs-dismiss="modal">Log in here</button>
                                                            </p>
                                                        </div>
                                                    </div>
                                                </div>
                                                <div className="col-md-12">
                                                    <button type="submit" className="site-button">Sign Up</button>
                                                </div>
                                            </div>
                                        </div>
                                        </form>
                                    </div>
                                </div>
                            </div>
                            <div className="modal-footer">
                                <span className="modal-f-title">Login or Sign up with</span>
                                <ul className="twm-modal-social">
                                    <li><a href="https://www.facebook.com/" className="facebook-clr"><i className="fab fa-facebook-f" /></a></li>
                                    <li><a href="https://www.twitter.com/" className="twitter-clr"><i className="fab fa-twitter" /></a></li>
                                    <li><a href="https://in.linkedin.com/" className="linkedin-clr"><i className="fab fa-linkedin-in" /></a></li>
                                    <li><a href="https://www.google.com/" className="google-clr"><i className="fab fa-google" /></a></li>
                                </ul>
                            </div>
                        </form>
                    </div>
                </div>
            </div>

        </>
    )
}

export default SignUpPopup;
